const Navbar = () => {
  return (
    <div className="w-full h-full px-4 py-2 bg-black text-white flex justify-between">
        <div>LOGO</div>
        <div>
            <div>Acceuille</div>
            <div>Contact</div>
        </div>
    </div>
  )
}

export default Navbar
